import React, {Component} from 'react';
//import logo from './logo.svg';
import './App.css';
import Movie from './Movie';


class App extends Component {
    //Render: componentWillMount() -> render() -> componentDidMount()
    //Update: componentWillReceiveProps() -> shouldComponentUpdate() -> componentWillUpdate() -> render() -> component


    state = {
        greeting: 'Hello!',
        movies: [
            {
                title: 'Oldboy',
                poster: 'data:image/jpeg;base64,'

            },
            {
                title: 'Star Wars',
                poster: 'data:image/jpeg;base64,'

            },
            {
                title: 'Full Metal Jacket',
                poster: 'data:image/jpeg;base64,'

            },
            {
                title: 'Matrix',
                poster: 'data:image/jpeg;base64,'

            }

        ]
    }

    componentDidMount() {
        setTimeout(() => {
            //this.state.greeting = 'something' //Do not mutate state directly. Use setState()
            this.setState({
                greeting: 'hello again!'
            })
        }, 5000)
    }

    render() {
        return (
            <div className="App">
                {
                    this.state.movies.map((movie, idx) => {
                        return <Movie title={movie.title} poster={movie.poster} key={idx}/>;
                    })
                }


            </div>
        );
    }
}

export default App;


